import { Component, Vue } from "vue-property-decorator";
import HelloWorld from "@/components/HelloWorld.vue";

@Component({
	components: {
		HelloWorld
	}
})
export default class About extends Vue {
	msg: string = "vue+typescript尝试";
	show() {
		console.log(123)
	}
}
